/*!40000 ALTER TABLE `perform_sop_policy` DISABLE KEYS */;
INSERT INTO `perform_sop_policy` VALUES (1,11,2,'O','S','S&S','Travel','Contextual knowledge and situational awareness about the operating environment- Find out about the security situation in the area of the country you are travelling to and ensure you have proper security clearance. This must be done for each journey. You may also need written authorisation from local authorities.','277','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(2,11,2,'O','S','S&S','Travel','Inform the appropriate offices of your arrival and make sure you have the contact numbers (official and private) of key staff.','107','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(3,11,2,'O','S','S&S','Travel','Be sure your office (Base) is aware of your plans. If you change plans, inform Base immediately.','','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(4,9,2,'O','S','S&S','Travel - Convoy','Mission planning - Be sure your vehicle has a copy of any government or local official authorization. If required, keep a typed copy, on official letterhead, of your local mission statement written in the local language.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(5,11,2,'O','S','S&S','Travel','Vehicle safety - for drivers and mission leaders; it is your responsibility to check that your vehicle has appropriate communication equipment and that it is in good working condition.','110','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(6,9,2,'O','S','S&S','Travel - Convoy','Vehicle safety - Ensure the vehicle is properly maintained and equipped (snow or desert tyres, torch, maps, water, etc.).','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(7,9,2,'O','S','S&S','Travel - Convoy','Vehicle safety - Inspect it (before you depart); check around and under it.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(8,9,2,'O','S','S&S','Travel - Convoy','Keep doors locked and windows closed while driving.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(9,9,2,'O','S','S&S','Travel - Convoy','Ensure you have adequate food, water, blankets, etc.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(10,9,2,'O','S','S&S','Travel - Convoy','Safe driving - Always wear your seatbelt.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(11,9,2,'O','S','S&S','Travel - Convoy','Safe driving - pay attention to speed limit once on the road and adjust your speed according to local laws and conditions and keep distance from other vehicles.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(12,9,2,'O','S','S&S','Travel - Convoy','Communication planning - Communicate and report regularly to office or control room.','110,5','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(13,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness - Use main roads but take alternate routes as necessary.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(14,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness - Avoid known ambush, sniper, and conflict areas.','1,101,105,106','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(15,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness - Beware of staged scenarios to make you stop your vehicle (e.g., an injured person on the road). Inform the nearest police station of the encounter.','1','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(16,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness - In a car-jacking situation do not argue or resist in any way. Hand over keys and other items on demand. Make a mental note of the description of the car-jacker if possible.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(17,9,2,'O','S','S&S','Travel - Convoy','Passengers policy - NEVER pick up hitchhikers. Think twice before deciding to offer assistance to what may appear to be a stranded motorist, regardless of gender.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(18,9,2,'O','S','S&S','Travel - Convoy','Vehicle safety - Before getting into your vehicle, look inside first to make sure no one is hiding in the back seat. Check underneath the vehicle from a distance.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(19,9,2,'O','S','S&S','Travel - Convoy','Safe driving - Whenever possible, travel on well-lit, populated streets. Keep the windows rolled up and KEEP THE DOORS LOCKED.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(20,9,2,'O','S','S&S','Travel - Convoy','Safe driving - Drive together with another vehicle, especially at night.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(21,9,2,'O','S','S&S','Travel - Convoy','When parking at night, select a place that will be lit when you return. When leaving your vehicle, make sure it is locked.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(22,9,2,'O','S','S&S','Travel - Convoy','Safe driving - If you suspect someone is following you, make a few turns down active streets. Do not drive into your own driveway or park in a deserted area.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(23,9,2,'O','S','S&S','Travel - Convoy','Safe driving - Be alert when you are at a red light or stop sign. Try to adjust your driving speed to avoid stopping at traffic lights. Be prepared to sound the horn and/or take evasive action if you are threatened.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(24,9,2,'O','S','S&S','Travel - Convoy','Vehicle safety - Keep your vehicle in good working order.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(25,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Know where you are going and how to get there. Carry a map with you.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(26,9,2,'O','S','S&S','Travel - Convoy','Safe driving - If someone attempts to force you off the road, blow your horn constantly to attract attention. If you are forced over, as soon as you stop, put your vehicle in reverse and back away. Blow your horn and keep the vehicle in motion.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(27,9,2,'O','S','S&S','Travel - Convoy','Safe driving - Do not operate communication systems while driving.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(28,9,2,'O','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Keep the driver informed of any new developments or information.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(29,8,2,'O','S','S&S','Travel - checkpoint','When approaching a checkpoint, reduce speed and be prepared to stop if required.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(30,8,2,'O','S','S&S','Travel - checkpoint','When approaching a checkpoint, wind the window down. If you are wearing sunglasses, then remove them to avoid intimidating people.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(31,8,2,'O','S','S&S','Travel - checkpoint','Keep both hands visible at all times.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(32,8,2,'O','S','S&S','Travel - checkpoint','When approaching a checkpoint, if it is dark, then turn on interior lights and dim headlights when you approach the checkpoint.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(33,8,2,'O','S','S&S','Travel - checkpoint','When communicating with the personnel at the checkpoint, try to maintain a friendly tone and be courteous. Always give truthful answers to questions.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(34,8,2,'O','S','S&S','Travel - checkpoint','When communicating with the personnel at the checkpoint, be patient, either you will be allowed through or you will not.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(35,8,2,'O','S','S&S','Travel - checkpoint','At the checkpoint, do not try to bribe your way out of danger.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(36,8,2,'O','S','S&S','Travel - checkpoint','At the checkpoint, show I.D. if asked, but do not hand it over; if demanded, politely resist and surrender if necessary.','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(37,8,2,'O','S','S&S','Travel - checkpoint','At the checkpoint, always stay in your vehicle. If necessary, explain your status, NGO affiliation and NGO mission. If ordered out, stay close to your vehicle.','4','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(38,8,2,'O','S','S&S','Travel - checkpoint','At the checkpoint, observe any search closely (watch for placement of incriminating material or theft).','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(39,8,2,'O','S','S&S','Travel - checkpoint','At the checkpoint, protest removal of items (but do not resist).','','A','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(40,13,2,'O','S','S&S','Travel - Landmine','Avoid places where fighting is ongoing or has taken place.','1, 101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(41,13,2,'O','S','S&S','Travel - Landmine','Avoid places around existing or abandoned military camps or military positions.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(42,13,2,'O','S','S&S','Travel - Landmine','Avoid places on or along the sides of unused footpaths or tracks.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(43,13,2,'O','S','S&S','Travel - Landmine','Avoid places on the soft edges along tarmac (hard surface) roads.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(44,13,2,'O','S','S&S','Travel - Landmine','Avoid places in and around culverts (drains) and bridges.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(45,13,2,'O','S','S&S','Travel - Landmine','Avoid places in and around abandoned houses.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(46,13,2,'O','S','S&S','Travel - Landmine','Avoid places in and around wells and water access points.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(47,13,2,'O','S','S&S','Travel - Landmine','Avoid places in low or hidden areas where people might be expected to take cover.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(48,13,2,'O','S','S&S','Travel - Landmine','Avoid places at stream crossing points.','101','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(49,13,2,'O','S','S&S','Travel - Landmine','Take (calls of nature) on the road behind the vehicle. Do not walk off the road.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(50,13,2,'O','S','S&S','Travel - Landmine','Beware of marked landmine fields - usually such areas are marked with skull and cross-bones signs on a red triangle.','1','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(51,13,2,'O','S','S&S','Travel - Landmine','NEVER go into areas marked by mine warning signs, wires, or tapes.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(52,13,2,'O','S','S&S','Travel - Landmine','NEVER touch, pull, or cut a tripwire.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(53,13,2,'O','S','S&S','Travel - Landmine','Anti-tank mines are normally detonated by the weight of a vehicle but not a person. Therefore, it is possible for an anti-tank mine to remain live even with pedestrian traffic. Whenever you see anti-tank mines, assume there are also anti-personnel mines.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(54,13,2,'O','S','S&S','Travel - Landmine','If you see children playing with what might be a mine or munitions, do not take it from them; tell them to put it down.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(55,13,2,'O','S','S&S','Travel - Landmine','NEVER keep any part of a mine or munitions as a souvenir.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(56,13,2,'O','S','S&S','Travel - Landmine','Use extra caution when travelling in previously mine-free areas following heavy rains or when walking along river banks, culverts (drains) along roads, and irrigation ditches. NEVER attempt to handle or move landmines or explosive remnants of war.','','P','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(57,13,2,'O','S','S&S','Travel - Landmine','Ensure that your route has been authorized before departure.','1, 99,101','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(58,13,2,'O','S','S&S','Travel - Landmine','Drive slowly; speed is not a priority over safety.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(59,13,2,'O','S','S&S','Travel - Landmine','When starting a journey, allow time for local traffic to travel the roads before you.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(60,13,2,'O','S','S&S','Travel - Landmine','Do not travel at night.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(61,13,2,'O','S','S&S','Travel - Landmine','Stay on hard-surfaced roads, even if the trip is longer.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(62,13,2,'O','S','S&S','Travel - Landmine','On dirt roads, stay on existing tracks.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(63,13,2,'O','S','S&S','Travel - Landmine','NEVER leave the road to allow a vehicle to pass, to overtake, to pass an obstruction, or to turn around.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(64,13,2,'O','S','S&S','Travel - Landmine','NEVER drive around roadblocks or former military positions.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(65,13,2,'O','S','S&S','Travel - Landmine','NEVER drive over anything on the road.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(66,13,2,'O','S','S&S','Travel - Landmine','Do not leave the road for any reason, even to relieve yourself.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(67,13,2,'O','S','S&S','Travel - Landmine','Reversing the vehicle out of a mined area should only be an option of last resort, if there is no possibility of mine rescue.','','P','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(68,13,2,'O','S','S&S','Travel - Landmine','Movement stops immediately. Stop any further movement of the vehicle, do not attempt to reverse out of the area, and do not move the steering wheel. Be calm and, if possible, stay in the vehicle. Help others to remain calm.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(69,13,2,'O','S','S&S','Travel - Landmine','Inform and warn people around you. Contact your office for help. Use the car horn to summon help.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(71,13,2,'O','S','S&S','Travel - Landmine','Evaluate the situation. Be prepared to take control.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(72,13,2,'O','S','S&S','Travel - Landmine','Do not move from your position. Wait for qualified help to come and assist you.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(73,13,2,'O','S','S&S','Travel - Landmine','When a vehicle strikes a mine. the first instinct of survivors is often to rush out. However, unless the vehicle is on fire or has ended up in a life-threatening position, stay in the vehicle. It is very likely that there will be more mines, including AP.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(74,13,2,'O','S','S&S','Travel - Landmine','You may be well into a mined field before you are aware of it. If you can, render First-Aid assistance to other passengers in the vehicle who require it.','','A','LM','*','R','*','',50,0,'','UNDSS documents & HPN documents'),(75,13,2,'O','S','S&S','Travel - Landmine','Movement stops immediately. Stop walking, stand still, remain calm, and keep breathing.','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(76,13,2,'O','S','S&S','Travel - Landmine','Inform and warn people around you. If you can, contact your office for help.','5,110','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(77,13,2,'O','S','S&S','Travel - Landmine','Note the area. What else can you see? (Remember the mine warning clues.).','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(78,13,2,'O','S','S&S','Travel - Landmine','Evaluate the situation. Be prepared to take control.','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(79,13,2,'O','S','S&S','Travel - Landmine','Do not move from your position. Wait for qualified help to come and assist you.','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(80,13,2,'O','S','S&S','Travel - Landmine','If you must leave the area, retrace your steps out of the area. However, remember that it is better to spend two days in a mined field than be injured or killed.','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(81,13,2,'O','S','S&S','Travel - Landmine','Do not rush! Exiting a mined field is a time-consuming and dangerous process.','','A','LM','*','*','*','',50,0,'','UNDSS documents & HPN documents'),(82,10,2,'O','S','S&S','Travel - Crossfire & Bombing','When you are on foot in the open, drop down, hit the ground, and crawl to the nearest cover if it is available.','','A','S','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(83,10,2,'O','S','S&S','Travel - Crossfire & Bombing','If you are on foot with cover nearby, drop down, hit the ground, and crawl to cover or hide behind something.','','A','S','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(84,10,2,'O','S','S&S','Travel - Crossfire & Bombing','If you come under fire while you are in a vehicle, accelerate and drive through if possible; if not possible, exit and hide behind the engine block. If there is better cover nearby, crawl to a ditch or cover (but beware of mines).','','A','S','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(85,12,2,'O','S','S&S','Travel - Kidnap','Avoid travel during the evening and in locations favoured by hijackers. Hijackings often take place after dark.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(86,12,2,'O','S','S&S','Travel - Kidnap','Be particularly alert when approaching or departing your residence.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(87,12,2,'O','S','S&S','Travel - Kidnap','Never set a pattern by driving the same route at the same time on a daily basis- avoid routines.','','P','*','*','R','*','',50,0,'','UNDSS & HPN documents'),(88,12,2,'O','S','S&S','Travel - Kidnap','Avoid travelling alone. Generally, hijackers are less likely to inflict serious injuries when two or more people are in a vehicle.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(89,12,2,'O','S','S&S','Travel - Kidnap','If possible, travel together with another vehicle. Hijackers rarely confront two vehicles.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(90,12,2,'O','S','S&S','Travel - Kidnap','Lock vehicle doors and keep windows closed, particularly when driving through crowded areas such as markets or busy streets.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(91,12,2,'O','S','S&S','Travel - Kidnap','Be alert when you are at a red light or stop sign. Try to adjust your driving speed to avoid pausing at traffic lights.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(92,12,2,'O','S','S&S','Travel - Kidnap','Keep your vehicle in good mechanical condition and develop the habit of filling the petrol tank when it is half full.','','P','*','*','R','*','',50,0,'','UNDSS documents'),(93,12,2,'O','S','S&S','Travel - Kidnap','Do not resist. Keep your hands in view.','','A','*','*','R','*','',50,0,'','UNDSS documents'),(94,12,2,'O','S','S&S','Travel - Kidnap','Do not make any sudden moves. Be especially careful reaching to release your seat belt. Explain what you are doing.','','A','*','*','R','*','',50,0,'','UNDSS documents'),(96,12,2,'O','S','S&S','Travel - Kidnap','Comply with the hijackers\' instructions quickly. The hijackers are probably nervous and want to leave the area as quickly as possible.','','A','*','*','R','*','',50,0,'','UNDSS documents'),(97,12,2,'O','S','S&S','Travel - Kidnap','Surrender personal items on demand (e.g., jewellery, purses, wallets, and briefcases).','','A','*','*','R','*','',50,0,'','UNDSS documents'),(98,12,2,'O','S','S&S','Travel - Kidnap','Do not provoke the hijackers with a display of anger or rude remarks.','','A','*','*','R','*','',50,0,'','UNDSS documents'),(99,9,2,'T','S','S&S','Travel - Convoy','Convoy planning - Obtain security clearance when planning to travel to high-risk areas.','1','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(100,9,2,'T','S','HUMLOG','Travel - Convoy','Maintain an up-to-date list of all vehicles and persons.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(101,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- When planning a mission or a convoy trip, make sure you have information on the current situation in the area and possible routes.','1','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(102,9,2,'T','S','S&S','Travel - Convoy','Mission planning - Ensure drivers have necessary papers and equipment.','4,5,6,7,99,101','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(103,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Work with field/regional to ensure procedures are in place in case of an emergency.','277','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(104,9,2,'T','S','S&S','Travel - Convoy','Remember convoys of six to eight vehicles can travel faster and are easier to manage than large convoys, it is recommended to organize several smaller convoys rather than one large one.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(105,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Mission leaders should research the possible convoy route and alternative ones. Find out about road conditions and talk to others who have been in the area recently.','101, 1','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(106,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Obtain up-to-date information on possible security risks in the areas along the planned convoy route.','1','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(107,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness- Measure the route and divide the journey into sections. Determine an estimated time of arrival (ETA) for each section. Pre-determine where the convoy will stop to rest and refuel.','105','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(108,9,2,'T','S','S&S','Travel - Convoy','Write down the route plan, including details of vehicles, persons, alternate routes, contingency plans, and procedures for aborting the operation. Where applicable, give a copy to the authorities and other local parties in the area.','100, 107,103,105','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(109,9,2,'T','S','S&S','Travel - Convoy','Set up a communication plan (i.e., when and where to check in with Base).','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(110,9,2,'T','S','S&S','Travel - Convoy','Vehicle safety - Ensure the vehicle weight and height do not exceed bridge/underpass specifications.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(111,9,2,'T','S','S&S','Travel - Convoy','Contextual knowledge and situational awareness - Brief all drivers before departure on the route, speeds, communication, order of vehicles, emergency action procedures, scheduled rest points, and estimated time of departure and arrival.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(112,9,2,'T','S','S&S','Travel - Convoy','Ensure all timings on your route plan enable you to reach a selected location well before nightfall. Do not travel after dark.','105,107','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(113,3,2,'O','S','S&S','Home','Contextual knowledge and situational awareness - Seek the advice of your security officer and knowledgeable colleagues about safe areas to live.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(114,3,2,'O','S','S&S','Home','Contextual knowledge and situational awareness - Ask about the nature of crime at the location and the type of security your residence should have.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(115,3,2,'O','S','S&S','Home','Site location - Pay attention to condition of streets and surrounding areas: Paved or unpaved, wide or narrow, etc.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(116,3,2,'O','S','S&S','Home','Site location - Pay attention to dense pedestrian and vehicular traffic could create security hazards.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(117,3,2,'O','S','S&S','Home','Site location -Pay attention to quality and quantity of lighting at night.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(118,3,2,'O','S','S&S','Home','Site location - Pay attention to safety of nearby family parks and playgrounds.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(119,3,2,'O','S','S&S','Home','Site location - Pay attention to types of residences in the area: Families with similar income levels tend to share similar lifestyles and security concerns.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(120,3,2,'O','S','S&S','Home','Site location - Pay attention to options for parking: The best is a secure garage that can be locked, followed by a private drive close to your residence; avoid distant, unsafe, underground, or street parking.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(123,3,2,'O','S','S&S','Home','Site location - Avoid apartments on the ground and first floors because of easy accessibility.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(124,3,2,'O','S','S&S','Home','Consider having a doorman or electronic system to control access to the lobby of your apartment building.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(125,3,2,'O','S','S&S','Home','Hedges and natural growth: These are useful in marking the property line. However, unless such barriers are thick and covered with thorns or pointed leaves, they can be easily crossed. Trim shrubbery so that it does not provide a hiding place.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(126,3,2,'O','S','S&S','Home','Picket and chain-link fences: Advantages of picket and chain-link fences include a view of the outside area, while not providing a hiding place for a potential intruder.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(127,3,2,'O','S','S&S','Home','Solid or block fences/walls: Although a solid wall limits your observation out of the area and could provide concealment for an intruder, it is usually the most secure perimeter.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(128,3,2,'O','S','S&S','Home','The perimeter barrier is no stronger than its gate. Ensure the gate is anchored well to the fence or wall, swings outward with hinges on the inside, and has a high-security lock. A solid or block wall should have a metal gate.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(129,3,2,'O','S','S&S','Home','Consider the installation of an emergency exit through the rear of the property, to be used only in high-risk situations.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(130,3,2,'O','S','S&S','Home','Grill all building exterior openings on the ground floor or accessible from trees, vehicle tops, sewage pipes, or porches.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(131,3,2,'O','S','S&S','Home','Most intruders will go to great lengths to escape visual detection. They will normally try to enter a residence that appears vacant or dark. Outdoor lighting can be a major deterrent against criminal or other intrusion.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(132,3,2,'O','S','S&S','Home','At least one grill in each bedroom should be hinged and equipped with an emergency release in case of fire.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(133,3,2,'O','S','S&S','Home','Place lighting so that it covers the walls of your residence and the ground area adjacent to perimeter walls. It should also illuminate shrubbery and eliminate blind spots.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(134,3,2,'O','S','S&S','Home','If you find that a window or door has been forced open or broken into while you were out, DO NOT ENTER. The intruder may still be inside. Quickly leave the area and call for help.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(135,3,2,'O','S','S&S','Home','Avoid sliding glass doors or have a metal grill installed with a heavy lock on the inside.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(136,3,2,'O','S','S&S','Home','Lock/Secure all utility boxes (electricity, water, and gas) located on the exterior of your residence.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(137,3,2,'O','S','S&S','Home','Do not put name identification on your gate or doors.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(138,3,2,'O','S','S&S','Home','Primary locks are the main lock on a door and are identified by the fact that they have handles. These locks are usually key-in-the-knob type locks.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(139,3,2,'O','S','S&S','Home','Auxiliary locks are usually deadbolts which do not have handles. This type of lock does not have to be keyed and may be nothing more than a sliding deadbolt.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(140,3,2,'O','S','S&S','Home','Change all exterior locks, including garage door and mail box lock, prior to moving into a new residence or if you lose your keys.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(141,3,2,'O','S','S&S','Home','NEVER hide exterior door keys outside the house.','','P','*','*','H','*','',50,0,'','UNDSS documents & HPN Documents'),(142,6,2,'O','S','S&S','Office/Project site','Ensure that the interior of the office has a reception area for receiving visitors, a system for close screening of visitors, and the means of quickly sealing the area in the event of a security incident.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(143,6,2,'O','S','S&S','Office/Project site','Ensure desks in public areas are free of anything that could be used as a weapon (e.g., scissors, letter opener, heavy paper weight, etc.).','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(144,6,2,'O','S','S&S','Office/Project site','Arrange office interiors simply so that strange or foreign objects left in the room will be recognized immediately.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(145,6,2,'O','S','S&S','Office/Project site','Ensure that confidential papers and travel plans are not exposed on desk tops.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(146,6,2,'O','S','S&S','Office/Project site','Ensure that unescorted visitors do not have direct access to staff offices.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(147,6,2,'O','S','S&S','Office/Project site','Ensure that name signs identifying officials are not placed on office doors.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(148,6,2,'O','S','S&S','Office/Project site','Install auxiliary lighting in all offices (in case of power failure).','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(149,6,2,'O','S','S&S','Office/Project site','Avoid working alone late at night and on days when the remainder of the staff is absent.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(150,6,2,'O','S','S&S','Office/Project site','Lock the office door when you vacate your office for any lengthy period, at night, and on weekends.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(151,6,2,'O','S','S&S','Office/Project site','Do not accept suspicious mail for individual colleagues. All incoming mail should be channelled through the mail unit to be screened.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(152,6,2,'O','S','S&S','Office/Project site','NEVER leave office keys on your desk.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(153,6,2,'O','S','S&S','Office/Project site','Do not leave valuables or money unsecured.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(154,6,2,'O','S','S&S','Office/Project site','If sharing an office or group of offices, stagger lunch hours and coffee breaks to ensure continuous occupation during working hours.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(155,6,2,'T','P','S&S','Office/Project site','Site location - Conduct a Security Survey. A security survey is an extremely important and useful exercise for any office. It examines virtually all aspects of office security. Under normal conditions, a security survey should be conducted once every two years.','275.1','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(156,6,2,'O','S','S&S','Office/Project site','Whenever you are outside the office, you are vulnerable. Know your options and be prepared to take action.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(157,6,2,'O','S','S&S','Office/Project site','As much as possible avoid leaving the office late at night. When not possible walk with other colleagues.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(158,12,2,'O','S','S&S','Office','If someone suspicious is behind or ahead of you, cross the street. If in doubt, use whatever means necessary to draw attention to yourself.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(159,6,2,'O','S','S&S','Office/Project site','Always keep your radio or cell phone ON so you can quickly call your radio room (Base), your security officer, or a colleague.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(160,11,2,'O','S','S&S','Office','If a driver pulls up alongside of you to ask for directions, do not approach the vehicle and beware of the suggestion to (look at this map)/Avoid talking to strangers.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(161,11,2,'O','S','S&S','Office','If a vehicle approaches and the driver threatens you, scream and run in the opposite direction of the car.','','P','*','*','R','*','',50,0,'','UNDSS documents & HPN Documents'),(162,11,2,'O','S','S&S','Office','Never hitchhike or accept a ride from a stranger; carpool wherever you can.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(163,6,2,'O','S','S&S','Office/Project site','Have your keys ready, but do not jiggle them in your hand as this will announce to others that you are on your way home.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(164,6,2,'O','S','S&S','Office/Project site','When travelling from/to office - Carry your handbag/backpack in a secure manner to prevent snatch-and-run type thievery.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(165,6,2,'O','S','S&S','Office/Project site','Keep only those keys on your key chain that you use. Do not have your name and address on your key chain. Ensure you can identify your keys quickly in the dark.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(166,6,2,'O','S','S&S','Office/Project site','Always carry identification. Seek advice from your security officer whether your I.D. should be visible or not outside organization premises.','','P','*','*','OC','*','',50,0,'','UNDSS documents & HPN Documents'),(167,5,2,'O','S','S&S','Mob Violence/hostile crowds','Do not panic, sometimes taking deep breaths helps.','','A','*','MV','*','*','',50,0,'','UNDSS documents & HPN Documents'),(168,5,2,'O','S','S&S','Mob Violence/hostile crowds','Incident reporting - Contact your security officer immediately.','','A','*','MV','*','*','',50,0,'','UNDSS documents & HPN Documents'),(169,5,2,'O','S','S&S','Mob Violence/hostile crowds','Leave the area as quickly as possible.','','A','*','MV','*','*','',50,0,'','UNDSS documents & HPN Documents'),(170,5,2,'O','S','S&S','Mob Violence/hostile crowds','If you are in a vehicle, do not get out. Check that the doors are locked, windows are rolled up, and try to leave by the safest means possible.','','A','*','MV','*','*','',50,0,'','UNDSS documents & HPN Documents'),(171,2,2,'O','S','S&S','First Aid ','Assessment & Reporting - Remember the S-S-S (Safety- Scene survey- Situation) principles when assessing the situation.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(172,2,2,'O','S','S&S','First Aid ','Assessment & Reporting - Safety: The most important rule of First Aid is that you protect yourself first. Evaluate all possible ongoing danger. The conditions that caused the accident may still be present. You cannot help others if you become a casualty yourself.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(173,2,2,'O','S','S&S','First Aid ','Assessment & Reporting - Scene Survey: Survey the scene to determine what really happened -- ask the victim or witnesses to explain what happened.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(174,2,2,'O','S','S&S','First Aid ','Assessment & Reporting - Situation: Assess how many casualties require attention. The order in which you treat them may be crucial to their survival. Attend first to anyone who is bleeding. Only move individuals if they are at risk of dying if you leave them where they are.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(175,2,2,'O','S','S&S','First Aid ','Assessment & Reporting - Remember the word METHANE to help you remember key facts when reporting an emergency event. (M: major incident, E: exact location, T: type of accident, H: are there any hazards? A: access to the incident site (is there any danger going to the scene?), N: Number and type of casualties, E: Emergency services present and required.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents. Also see https://www.prometheusmedical.co.uk/prometheus-mobile-applications-old'),(176,2,2,'O','S','S&S','First Aid','Training: Attend a First-Aid Course.','276','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(177,2,2,'O','S','S&S','First Aid','Training: If assigned or travelling to a remote location, must attend a First-Aid course prior to departure date.','176','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(178,2,2,'T','S','S&S','First Aid','Assessment & Reporting - Need to send an immediate alert message for help and arrange urgent removal to medical facilities.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(179,2,2,'O','S','S&S','First Aid','Evacuating victims - Unless there is an immediate danger, do not remove the victim from the vehicle.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(180,2,2,'O','S','S&S','First Aid','Bleeding - Stop any bleeding by applying direct pressure and maintain the head of the victim in the neutral position, the eyes looking at the horizon.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(182,2,2,'O','S','S&S','First Aid','Bleeding - Wear protective gloves.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(183,2,2,'O','S','S&S','First Aid','Bleeding - Lay the injured person(s) down. It may help.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(184,2,2,'O','S','S&S','First Aid','Bleeding - Remove or cut clothing to expose the wound.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(185,2,2,'O','S','S&S','First Aid','Bleeding - Apply direct pressure over the wound with your fingers or palm, preferably over a sterile dressing or clean pad but do not waste time hunting for a dressing (use a T-shirt if nothing else).','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(186,2,2,'O','S','S&S','First Aid','Bleeding - Leave any original pad or bandage in place and, if you need to, add another on top. Bandage it in place firmly, but not so tight as to impede circulation. If bleeding continues through the dressing, bandage another firmly over the top.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(187,2,2,'O','S','S&S','First Aid','Bleeding - Check periodically that you have not cut off circulation with the bandage and find someone to assist you.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(188,2,2,'O','S','S&S','First Aid','Do not remove the wounding body (knife, screwdriver, etc.) if it is still protruding from the wound. Watch out for sharp objects that may injure you.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(189,2,2,'O','S','S&S','First Aid','Fractures - Try to immobilize all potential fractures in the position you find them. Movement of internally broken bones can increase bleeding as rough ends may cut blood vessels.','176','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(190,1,2,'O','S','S&S','Abduction','Be cooperative and obey the hostage takers\' demands without appearing either weak or aggressive. Be conscious of your body language as well as your speech. Do not say or do anything to arouse the hostility or suspicions of your abductors, act natural.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(193,1,2,'O','S','S&S','Abduction','Do not speak unless spoken to, and then only when necessary. Be cautious about making suggestions to your abductors, as you may be held responsible if something you suggest goes wrong.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(196,1,2,'O','S','S&S','Abduction','If it feels right, build rapport with your abductors. Find areas of mutual interest, which emphasize personal rather than political interests. A neutral topic of discussion could be leisure activities.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(199,1,2,'O','S','S&S','Abduction','Try to think of reasons why hostage takers should not harm you. Encourage them to let authorities know your condition. It is important that your abductors view you as a person worthy of compassion and mercy. NEVER beg, plead, or cry. Figure out a way to m.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(202,1,2,'O','S','S&S','Abduction','If you end up serving as a negotiator between the hostage takers and authorities, make sure the messages are conveyed accurately. Be prepared to speak on the radio or telephone.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(205,1,2,'O','S','S&S','Abduction','Do not make threats against hostage takers or give any indication that you would testify against them. If hostage takers are attempting to conceal their identities, given no indication that you recognize them.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(208,1,2,'O','S','S&S','Abduction','Do not fight back or attempt to aggravate hostage takers. You may be injured if you attempt to resist armed individuals. There is a possibility that you will be blindfolded.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(211,1,2,'O','S','S&S','Abduction','Keep calm and obey orders. Immediately after you have been taken, pause, take a deep breath, and try to relax. Fear of death or injury is a normal reaction to this situation.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(214,1,2,'O','S','S&S','Abduction','Do not speak unless spoken to. Do not be a hero; do not talk back or act tough. Accept your situation. Any action on your part could bring a violent reaction from your abductors.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(217,1,2,'O','S','S&S','Abduction','Do not whisper to companions, offer suggestions, make jokes, or argue.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(220,1,2,'O','S','S&S','Abduction','Do not make sudden moves; ask first.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(223,1,2,'O','S','S&S','Abduction','Be certain that you can explain everything you have in your possession.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(226,1,2,'O','S','S&S','Abduction','Try not to give up ID or clothes.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(229,1,2,'O','S','S&S','Abduction','If you speak their language, use it.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(232,1,2,'O','S','S&S','Abduction','Try to stay calm and control your emotions especially in the first 45 minutes of a hostage situation as they are most dangerous moments in this situation.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(235,1,2,'O','S','S&S','Abduction','Follow the instructions of the abductors.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(238,1,2,'O','S','S&S','Abduction','The abductors are in a highly elevated emotional state. Thus, they could react violently to any provocation.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(241,1,2,'O','S','S&S','Abduction','Your job is to survive. After the initial shock wears off, the abductors may calm down.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(244,12,2,'O','S','S&S','Travel - Kidnap','Be aware that over 50% of kidnapping victims are taken from vehicles.','','P','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(247,1,2,'O','S','S&S','Abduction','Be patient. Try to rest.','','A','S-RSA','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(248,1,2,'O','S','S&S','Abduction','Request medication or aid you might need.','','A','S-KK','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(251,1,2,'O','S','S&S','Abduction','Be polite, listen well, and do not argue.','','A','S-RSA','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(252,1,2,'O','S','S&S','Abduction','Stay alert and try to observe as many signs or listen to as many sounds as possible to determine where you are being taken.','','A','S-K','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(253,4,2,'O','S','S&S','Hostage or detention','In confinement - Anticipate isolation and possible efforts by the hostage takers to disorient you (loud music, lack of sleep, movement from one location to another). Devise a method of keeping track of time.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(256,4,2,'O','S','S&S','Hostage or detention','In confinement - Try to keep calm by focusing your mind on pleasant scenes, memories, or prayers. Try to recall the plots of movies or books.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(259,4,2,'O','S','S&S','Hostage or detention','In confinement -Ask for anything you need or want (medicines, books, paper, etc.). They may refuse, but you can try.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(260,4,2,'O','S','S&S','Hostage or detention','In confinement -Exercise daily. Develop a physical fitness programme and stick to it.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(261,4,2,'O','S','S&S','Hostage or detention','In confinement -You may have difficulty retaining fluids and may experience a loss of appetite and weight. Try to drink water and eat even if you are not hungry. It is important to maintain strength.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(263,4,2,'O','S','S&S','Hostage or detention','In confinement -Keep a low profile. Avoid appearing to study your abductors, although, if you can, you should make mental notes about their appearance, clothes, and rank structure.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(264,4,2,'O','S','S&S','Hostage or detention','In confinement -If possible, stay well-groomed and clean.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(265,4,2,'O','S','S&S','Hostage or detention','In confinement - Do whatever you can to maintain a positive frame of mind.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(266,4,2,'O','S','S&S','Hostage or detention','Release or rescue - During any rescue by force, immediately drop to the floor or ground and take cover.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(267,4,2,'O','S','S&S','Hostage or detention','Release or rescue -To avoid serious injury during rescue, keep your hands on your head.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(269,4,2,'O','S','S&S','Hostage or detention','Release or rescue -After the rescue is over, call to rescuers from your position on the floor or ground and follow their instructions.','','A','*','*','*','*','',50,0,'','UNDSS documents & HPN Documents'),(270,5,2,'O','S','S&S','Mob Violence/hostile crowds','Security risk assessment - Assess the situation calmly and determine the need for security measures, including your departure.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(271,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - If possible, determine goals and demands.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(272,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - If appropriate, consider liaison with the group. Attempt to speak only to the designated spokesperson, preferably apart from the main group.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(273,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - If appropriate, propose a working committee to discuss and find solutions for grievances, requests, etc.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(275,7,2,'S','P','S&S','SRM','Staff members who are assigned to work in the field or high-risk regions must attend a basic security training course.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(276,7,2,'S','P','S&S','SRM','Staff members who are assigned to work in the field or high-risk regions must to attend a First Aid course.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(277,7,2,'T','P','S&S','SRM','Conduct a Security Risk Assessment. Security risk assessment process is an important and useful exercise for any office. It examines all aspects of potential risks and probable impact under different situations and threat types. Assessments must be conducted in the mission planning phase and whenever is needed.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(278,7,2,'O','S','S&S','SRM','Attend a basic security training course.','275','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(279,7,2,'O','S','S&S','SRM','Based on security risk level, perform the update call with main office.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(280,3,2,'O','S','S&S','Home','Site location - Avoid apartments beyond the fire fighting and rescue capabilities of the local fire department. Check with your security officer for advice.','','P','*','*','*','*','',0,0,'',''),(281,5,2,'T','S','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - Inform the authorities of the situation and consider asking for special protection. This can be a very effective strategy if the authorities are willing and able to control crowds.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(282,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - Listen attentively and respectfully; avoid making quick promises about the issue in contention. Signal that you are taking note of the grievances and are willing to pursue the discussion further, but not under threat or duress. In other words, try to negotiate an agreement for talks in a setting where the angry mob is not at the door.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(283,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - Hold the talks/or negotiations in the agency compound, but not in the heart of the building. Consider the risk of going outside the compound to negotiate  be sure you wont be attacked.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(284,5,2,'O','S','S&S','Mob Violence/hostile crowds','Negotiating with crowds - Seek advice from local staff who can understand what is being shouted, and who may be able to identify who the demonstrators are and who appears to be controlling or driving them.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(285,5,2,'O','S','S&S','Mob Violence/hostile crowds','Evacuation - When considering evacuating the office or project site: 1) all employees should prepare for evacuation from the building.  2) Consider whether to take essential items, such as laptops, satellite telephones, radio equipment and essential files. 3)  Lock the doors of all rooms that are vacated. 4)exit the compound at a place where the crowd has not yet gathered and where staff are not visible to it.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(286,5,2,'O','P','S&S','Mob Violence/hostile crowds','Security assessment and mitigation planning - Staff should be familiar with alternative back routes in advance. When planning a mission or choosing an office location; security measures and mitigation planning should be taken into account.','','P','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(287,5,2,'T','P','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - Designate one person to contact other agencies that might be at similar risk. In this case the NGO security officer or information officer.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(288,5,2,'T','P','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - Maintain heightened security for some days until the situation has clearly calmed down and there is no perceived risk of individual retaliation.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(289,5,2,'T','P','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - consider the agencys public relations position and what messages, if any, the agency passes out.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(290,5,2,'T','P','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - After resolving the situation, the organization needs to keep its word: hold talks, even if police protection has now been increased. Communicate not just with the formal authorities but also with the wider environment of ordinary people.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(291,5,2,'S','P','S&S','Mob Violence/hostile crowds','Contextual knowledge and situational awareness - Community acceptance: After resolving the situation, the organization might need to review its acceptance strategy and will need to re-establish relationships and perhaps repair acceptance.','','A','*','MV','*','*','',0,0,'','UNDSS documents & HPN Documents'),(292,6,2,'S','P','S&S','Office/Project site','Contextual knowledge and situational awareness - Site protection starts with site selection, therefore, conduct a risk assessment to identify different types of possible threats and vulnerabilities (security threats, extreme weather conditions, natural disasters like floods and mud slides, etc.).','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(293,6,2,'S','P','S&S','Office/Project site','Site location - Consider how easy it would be to get out of the building or the immediate area in the event of fire: are there different exit routes, and can the local fire brigade get close enough to the building?','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(294,6,2,'S','P','S&S','Office/Project site','Site location - Avoid areas that offer many possibilities for concealed approaches and escapes, for example areas with dense bush or a dry river bed, with narrow, dark alleyways, with factory grounds, storage spaces and warehouses that are largely abandoned at night or containing damaged and destroyed buildings.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(295,6,2,'S','P','S&S','Office/Project site','Site location - check if there are any locations of importance with political, or socioeconomic, or religious targets (government buildings, police stations, a temple of a religious minority, headquarters of a militant group, office of an opposition newspaper, a radio station etc.).','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(296,6,2,'T','P','S&S','Office/Project site','Site location - Organisation might consider tactics such as cutting down on movements through risky areas, relocating sites away from risky areas, withdrawing staff considered to be at risk, limiting or reducing stocks in warehouses and temporarily moving valuables such as office equipment to the residences of local staff.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(297,6,2,'S','P','S&S','Office/Project site','Contextual knowledge and situational awareness - Keep a low profile and reduce visibility by removing agency logos and flags from buildings and cars, limiting the movements of international staff who stand out among local people and renting local cars or using taxis rather than conspicuous four-wheel-drive agency vehicles. Closely monitor any demonstrations.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(298,6,2,'T','P','HUMLOG','Office/Project site','Contextual knowledge and situational awareness - The logistical movement of distribution items, especially food, needs to be carefully planned. Movements should be planned tactically to minimise visibility of cargo and timed to avoid passing through areas where beneficiaries in need may be tempted to loot (e.g. routes and time of day or night).','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(299,6,2,'T','P','HUMLOG','Office/Project site','Contextual knowledge and situational awareness - Distribution site: Understand your beneficiaries. It is important to know how they view the distribution. Are they desperate for the items being distributed? Are there potential tensions between beneficiaries? Is political interference possible or likely? Are there elements that may have an interest in manipulating the distribution?','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(300,6,2,'O','S','HUMLOG','Office/Project site','Site location - Distribution site: Have a well-defined perimeter appropriate to the situation; in some instances, fencing or walls may be necessary, in others barricades of some sort may be acceptable, with additional monitoring.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(301,6,2,'O','S','HUMLOG','Office/Project site','Site location - Distribution site: The site should be in a place where ambient traffic (both vehicular and pedestrian) is not impeded. It should not invite unwanted bystanders.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(302,6,2,'O','S','HUMLOG','Office/Project site','Site location - Distribution site: There should be one entry point and one exit point. Crowds at the entry point should be well managed so that the organisation can quickly separate legitimate beneficiaries from illegitimate ones  have a plan and staff on hand to deal with unruly individuals. Exit points should be managed with equal detail, ensuring that beneficiaries can leave the distribution site in an orderly and safe manner.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(303,6,2,'O','S','S&S','Office/Project site','Logistics and planning - Distribution site: Staff or the authorities should ensure that crowds (including family members that may come to help carry the load) do not gather and impede departure. It is very important to keep people moving. Agencies should be mindful of the potential protection issues for those leaving the distribution site, especially women and young children.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(304,6,2,'O','S','HUMLOG','Office/Project site','Logistics and planning - Distribution site: Within the distribution site, the organisation should have a clear process that allows people to move on quickly  problems may occur when people are forced to wait in groups.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(305,6,2,'O','S','HUMLOG','Office/Project site','Logistics and planning - Distribution site: Keep in mind how the distributed items will be bundled. Will the individuals receiving them be able to carry them in such a way that they are not made more vulnerable when they leave the distribution site? Think of ways to make distributed items less obvious as the beneficiary travels home.','','P','*','*','OC','*','',0,0,'','UNDSS documents & HPN Documents'),(306,7,2,'T','S','S&S','Tracking','Based on security risk level, staff members who require tracking will be designated by the NGO Security Officer. Designation is based on the risk level and risk profile of the designee.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(307,7,2,'O','S','S&S','Tracking','When designated for tracking, use of the tracking system is mandatory.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(308,7,2,'O','S','S&S','Tracking','Tracking check-in: After every travel (i.e. return from R&R, arrival at travel destination, etc.) staff is required to check-in with a message.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(309,7,2,'O','S','S&S','Tracking','Tracking update frequency - In LOW risk areas: 1) When at the base station/NGO office  off;2) When traveling for work purposes outside the base station/NGO office  update frequency is set to 24 hours.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(310,7,2,'O','S','S&S','Tracking','Tracking update frequency - In MODORATE risk areas: 1) When at the base station/NGO office  update frequency is set to 24 hours; 2) When traveling for work purposes outside the base station/NGO office  update frequency is set to 60 min.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(311,7,2,'O','S','S&S','Tracking','Tracking update frequency - In HIGH risk areas: 1) When at the base station/NGO office  update frequency is set to 24 hours ;2) When traveling for work purposes outside the base station/NGO office  Report all departure / arrival using check-in + message AND Updates frequency is set to 10 min.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(312,7,2,'O','S','S&S','Tracking','Tracking update frequency - In EXTREME risk areas: 1) When at the base station/NGO office  update frequency is set to 8 hours ;2) When traveling for work purposes outside the base station/NGO office  Report all departure / arrival using check-in + message AND Updates frequency is set to 5 min.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(313,8,2,'O','S','S&S','Travel - checkpoint','When approaching a checkpoint, inform control room/base office (or NGO security officer) before approaching the checkpoint and resume contact when you have passed it, but consider turning off the radio if you feel that it might attract unwelcome attention while passing through the checkpoint.','','A','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(314,8,2,'O','S','S&S','Travel - checkpoint','When communicating with the personnel at the checkpoint, a spokesperson should be identified beforehand. Oftentimes, drivers play that role, and sometimes they act as a translator. Drivers should have a clear understanding of when to switch roles from spokesperson to translator.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(315,8,2,'O','S','S&S','Travel - checkpoint','When approaching a checkpoint, it is important to perform a rapid assessment and assess the type of checkpoint ahead. Not all checkpoints are equally critical.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(316,8,2,'O','S','S&S','Travel - checkpoint','Checkpoint rapid assessment - when conducting the checkpoint type rapid assessment, key questions are: where it is located, who is manning it and what their mood appears to be.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(317,8,2,'O','S','S&S','Travel - checkpoint','Keep in mind that checkpoints usually are located at crossroads, bridges, mountain passes and town entrances and exits, and are likely to have been set up for the general monitoring of all passers-by.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(318,8,2,'O','S','S&S','Travel - checkpoint','Be aware of checkpoints in the middle of a forest or on a mountain road away from habitation, it can be a fake checkpoint or may exist for a more ominous purpose.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(319,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - Convoys can take various forms depending on their composition and what they are transporting; the numbers and types of vehicles, and the type of cargo, will determine the convoys length and speed.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(320,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - When planning a large convoy may reduce risk through strength in numbers. However, there are disadvantage, the convoy will move more slowly; the convoy can portray an image of power and wealth and attract unwanted attention and stir up resentment. Also, a large convoy might be mistaken from afar for an army column on the move.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(321,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - Small convoys can be more vulnerable to ambush but are perhaps easier to negotiate through checkpoints, move faster and less likely to come under aerial attack.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(322,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - Convoys need to be managed, and should have a leader, thus a mission leader must be assigned and engaged in the process of planning the convoy.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(323,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - A journey plan must be prepared, and an assembly point and assembly time must be established well before departure.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(324,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - Precise details of all vehicles must be obtained from the logistics officer, along with the passengers and cargo. Assemble all the documentation that will be required. Usually the logistics officer maintains an inventory of all the information needed about the personnel, vehicles and the cargo.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(325,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - How vehicles are organized in the convoy depends on the number and types of vehicle there are (trucks, buses, four-wheel-drive passenger vehicles, a water tanker, an ambulance, an armoured personnel carrier) and what cargo and assets they are carrying.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(326,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - How vehicles are organized in the convoy depends on the types of threats and problems anticipated (a vehicle getting stuck in the mud during a river crossing, heavy trucks unable to climb a snowy road, a road block by irregulars, mines, physical aggression, etc.).','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(327,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - Vehicle line up in the convoy, in case of threats related to security, should include assigning a scouting vehicle ahead of the convoy. However, this needs to maintain radio contact; and the deputy convoy leader should be placed in the scouting vehicle, rather than the leader him/herself.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(328,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - A local guide can be placed in the scouting vehicle if necessary or the guide can stay with the main convoy.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(329,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - The convoy leader should be in the front, but there should also be someone at the rear of the convoy with experience and decision-making authority.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(330,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - establish a communication protocol between the front and the rare of the convoy. E.g. decide whether to maintain radio or establish a signal code using car horns and headlights.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(331,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - in case of including armed escorts in the convoy, then armed escorts should be in separate vehicles. If the escorts do not have their own transport, you may provide a vehicle, but all organization identification marks should be removed. Ideally, an armed escort should be split over more than one point in the convoy.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(332,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - In case the convoy includes buses or other passenger vehicles, then those vehicles should be in the middle, with medical supplies and food, water and blankets.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(333,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - Ensure to include a sufficient number of vehicles so that, if one breaks down, the convoy can continue.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(334,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - General scenario rules should include establishing how the convoy will act when approaching a checkpoint, what it will do if one vehicle experiences problems at a checkpoint while the others get clearance.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(335,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - General scenario rules should include establishing how the convoy will act when if a vehicle breaks down but cannot immediately be repaired. There have been instances of truck drivers being killed when their vehicle broke down and they stayed behind.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(336,9,2,'O','S','HUMLOG','Travel - Convoy','Convoy planning - The distance between the vehicles in a convoy may varies according to the terrain and the weather and security conditions and may have to be adjusted over the course of the journey.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(337,9,2,'O','S','S&S','Travel - Convoy','Convoy planning - Maintaining the right distance between convoy vehicles can be difficult. However, vehicles should never be so far apart that visual contact is lost. At the same time vehicles should not be so close together that they get caught in the same incident (an ambush, a roadside bomb, slipping into each other on an icy road, damage from a mine explosion).','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(338,9,2,'T','P','HUMLOG','Travel - Convoy','Contextual knowledge and situational awareness -The logistical movement of distribution items, especially food, needs to be carefully planned. Movements should be planned tactically to minimise visibility of cargo and timed to avoid passing through areas where beneficiaries in need may be tempted to loot (e.g. routes and time of day or night).','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(339,10,2,'O','S','S&S','Travel - Crossfire & Bombing','Contextual knowledge and situational awareness - Always make sure to get security updates and stay away from areas where small-arms fire is being exchanged or where snipers are operating.','','P','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(340,10,2,'S','S','S&S','Travel - Crossfire & Bombing','Consider providing field workers with flak jackets, ballistic or bullet-proof jackets. However, flak jackets are designed to protect parts of the body from blast, flying glass and shrapnel. They will not stop a bullet. Ballistic or bullet-proof jackets give more protection. Basic jackets should be worn with ballistic plates and a helmet.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(341,10,2,'S','P','S&S','Travel - Crossfire & Bombing','Consider hiring armoured vehicles for travelling through high-risk areas. However, armoured vehicles can offer some protection from rifle fire and from the blast effects of shells and smaller mines. They will not provide adequate protection from a direct hit by artillery, a bomb or an RPG, or from specialist sniper fire, which may use armour-piercing bullets.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(342,10,2,'O','S','S&S','Travel - Crossfire & Bombing','When driving or walking in hilly or mountainous roads or areas, avoid stopping on high ground where you will be very exposed. Find relative safety from shelling and bombing at the foot of a steep hill or mountain.','','P','S','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(343,10,2,'T','P','S&S','Travel - Crossfire & Bombing','Office location - Do not locate offices and warehouses close to obvious or likely military targets, such as airfields, barracks, fuel depots, official buildings or strategic points such as crossroads, railheads, power stations and radio and TV buildings. Avoid hotels near potential targets.','','P','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(344,10,2,'T','P','S&S','Travel - Crossfire & Bombing','In the case of a project site, where the agency is working, is in a town of strategic military value that is likely to come under fire, move as far to the outskirts as operational requirements permit, or to nearby countryside.','','P','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(345,10,2,'T','P','S&S','Travel - Crossfire & Bombing','Consider implementing some physical protection measures to reduce the damage from near-misses and the effect of blast and shrapnel. E.g. underground shelters, anti-blast walls, refuge trenches with sandbags, install anti-blast film for windows etc.','','P','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(346,10,2,'O','S','S&S','Travel - Crossfire & Bombing','In case of driving and come under fire, if under close frontal fire while driving, you will probably need to stop the vehicle, jump out and seek cover; stopping and reversing or turning and exposing the flank of the vehicle will take too long and will present an easy target.','','A','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(347,10,2,'O','S','S&S','Travel - Crossfire & Bombing','In case of driving attempting to take evasive action from small-arms fire, go for speed. Avoid swerving or zigzagging; it does not make you harder to hit.','','A','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(348,10,2,'O','S','S&S','Travel - Crossfire & Bombing','When come under fire, you need to seek immediate cover in the nearest shelter or emergency trench.','','A','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(349,10,2,'O','S','S&S','Travel - Crossfire & Bombing','If you cannot reach a bomb shelter seek other, solid cover. A tree, a wooden fence or a car wont do. Something much more solid is needed, for example walls, concrete, rock or a deep hole, such as a ditch on the side of the road. If you are exposed, lie down flat. Exposure to blast can damage eardrums: remember to cover your ears with your hands and keep your mouth slightly open.','','A','S','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(350,10,2,'O','S','S&S','Travel - Crossfire & Bombing','In case of driving and come under fire, if the artillery fire is not too close and you can drive away, try to reach a safer location that offers proper cover.','','A','S','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(351,10,2,'O','S','S&S','Travel - Crossfire & Bombing','In case of driving and come under fire, if the shelling is close by or you are stuck in a convoy you should get out and seek cover away from the vehicle. (Inside the vehicle you are at risk of flying glass, shrapnel piercing the car or the fuel tank exploding if the car is hit by a shell.).','','A','S','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(352,10,2,'O','S','S&S','Travel - Crossfire & Bombing','In case of air-strikes, always assume that your vehicle will be targeted. Get out and seek cover.','','A','AB','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(353,10,2,'O','S','S&S','Travel - Crossfire & Bombing','If you have to drive around in a danger zone keep the radio volume low and the window slightly open and stay alert.','','A','S','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(354,11,2,'O','P','S&S','Travel','Vehicle safety - Fleet vehicles must maintain a good working order: water, oil and fuel levels checked, tyres in good condition, seat belts installed and used, essential equipment (jack, spare tyres, first aid kit etc.) present.','','P','*','*','R','*','',0,0,'',''),(355,11,2,'O','P','S&S','Travel','Vehicle safety - Logistics manage should keep a servicing and maintenance schedule of the organization\'s fleet vehicles.','','P','*','*','R','*','',0,0,'',''),(356,11,2,'O','P','S&S','Travel','Vehicle safety - All drivers must check their vehicles daily; all vehicles should be crosschecked before major journeys.','','P','*','*','R','*','',0,0,'',''),(357,11,2,'S','P','S&S','Travel','Contextual knowledge and situational awareness - Organisations should ensure that procedures are in place to fully inform staff and visitors of the general context and specific security considerations for their country, region and area of operation.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(358,11,2,'S','P','S&S','Travel','Pre-deployment preparations are a joint or shared responsibility between employer and employee. The organisations management has a responsibility to ensure the traveller has access to the necessary information and training.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(359,11,2,'O','P','S&S','Travel','Pre-deployment preparations are a joint or shared responsibility between employer and employee. Thus, it is staff responsibility to ensure they are adequately informed and prepared. Critical elements to go through prior to travelling include: Health risks and prevention; Risks of crime and violence; Natural disaster risks; Accident risks (e.g. safety concerns about local airlines or boat or bus services); Essential telephone numbers (office, mobile phones of key staff, medical facilities, the police, key embassies); A map of the city with key locations (including office and hotel) clearly identified.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(360,11,2,'O','P','S&S','Travel','Vehicle safety - Car users (drivers, aid workers, translators etc) should be taught how to do basic emergency repairs.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(361,11,2,'S','P','S&S','Travel','Contextual knowledge and situational awareness- If needed, establish clear no-go zones in the cities or areas in where the organization works and also enforce a no-night-driving policy for any trips, professional or personal, outside of the city centre.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(362,11,2,'S','P','S&S','Travel','In insecure environments, organizations must ensure that drivers have security training, and they regularly included in meetings with the logistics managers and security managers.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(363,11,2,'S','P','S&S','Travel','Incident management - Guidelines should be set out on how to react in case of an accident, especially if it causes the injury or death of local people.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(364,11,2,'S','P','S&S','Travel','Protection against theft - A number of devices help to protect vehicles from theft, including lockable fuel filler caps, lockable wheel nuts and steering locks.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(365,11,2,'S','P','S&S','Travel','Communication planning - Using VHF and HF radios provide the ability to monitor vehicle movements and enable drivers to report problems and call for assistance. However, driving around with huge antennae attached to the car also defeats any attempts to keep a low profile and may mark the vehicle out as a worthwhile target for militias or criminals.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(366,11,2,'S','P','S&S','Travel','Communication planning - Using mobile phones (or smart-phones) are a more useful and practical communication tools compared to radios, however, it should not be the sole communication tool. Smart-phones can be used as a backup as well.','','P','*','*','*','*','',0,0,'','UNDSS documents & HPN Documents'),(367,11,2,'S','P','S&S','Travel','Vehicle tracking systems - tracking systems provide the ability to follow a vehicle and indicate its location on maps stored in the control room main computer. tracking systems can also be used to issue a warning signal when the vehicle is approaching an exclusion zone.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(368,11,2,'O','S','S&S','Travel','When travelling, generally a good practice is to try avoiding or keeping a significant distance from any security force convoys or even single security-force vehicles.','','P','*','*','R','*','',0,0,'','UNDSS documents & HPN Documents'),(369,11,2,'O','S','S&S','Travel','When travelling in high-risk areas and if it happens to be in the vicinity of an explosion, passengers are advised to initially avoid the natural impulse to go closer and investigate or assist. The best advice is to stop, get out of the vehicle and take cover on the ground or at the side of the road to avoid any possible crossfire.','','A','*','*','R','*','',0,0,'',''),(370,12,2,'S','S','S&S','Travel - Kidnap','Perform a programme risk assessment at early stages of the programme planning.','','P','*','*','R','*','',0,0,'','HPN documents'),(371,12,2,'S','P','S&S','Travel - Kidnap','Provide staff with specialized training and orientation that target kidnapping and hostage situations.','','P','*','*','R','*','',0,0,'','HPN documents'),(372,12,2,'S','P','S&S','Travel - Kidnap','Establish an incident management plan that address threat situations including kidnapping and hostage taking.','','P','*','*','R','*','',0,0,'','HPN documents'),(373,12,2,'S','P','S&S','Travel - Kidnap','Establish links to local and international expertise for effective incident management support.','','P','*','*','R','*','',0,0,'','HPN documents'),(374,12,2,'S','P','S&S','Travel - Kidnap','Cultural awareness is critical, therefore, having an acceptance strategy is crucial for the programme and the smoothness of the operations in the region.','','P','*','*','R','*','',0,0,'','HPN documents'),(375,12,2,'S','P','S&S','Travel - Kidnap','Remove potential vulnerabilities - withdraw staff members at risk (e.g. international staff) and relocate outside the country.','','P','*','*','R','*','',0,0,'','HPN documents'),(376,12,2,'S','P','S&S','Travel - Kidnap','Armed protection - consider having armed protection at the organization office(s), international staff residence, and on the move.','','P','*','*','R','*','',0,0,'','HPN documents'),(377,12,2,'S','P','S&S','Travel - Kidnap','Kidnap and ransom insurance - consider this type of insurance policy that cover costs related to transport, communications, medical and trauma counselling cost and sometimes the cost of a case manager to handle negotiations.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(378,12,2,'S','P','S&S','Travel - Kidnap','Establish a Critical Incident Management Team: Provide adequate training to the CIMT members including using simulations of kidnap scenarios that involves operations, IT, personnel, finance, media and legal department staff and management personnel.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(379,12,2,'S','P','S&S','Travel - Kidnap','Establish a policy for deployments to high-risk areas, the staff should be fully informed of the risk in advance, and thus there should be an explicit consent or agreement to work in such conditions.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(380,12,2,'S','S','S&S','Travel - Kidnap','Constantly monitor high-risk zones for possible kidnapping threats.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(381,12,2,'S','S','S&S','Travel - Kidnap','Identify qualified external experts for crisis management and post-crisis support to potential victims and their families.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(382,12,2,'T','S','S&S','Travel - Kidnap','Establish and maintain contact with the embassy and other diplomatic actors, such as the UN.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(383,12,2,'T','S','S&S','Travel - Kidnap','In a high-risk environment, know who to contact in the host government in the event of a kidnapping.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(384,12,2,'T','S','S&S','Travel - Kidnap','Find out the command structure of the national security forces in the agencys area of operation.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(385,12,2,'T','S','S&S','Travel - Kidnap','Identify and get acquainted with a reliable and competent local criminal lawyer.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(386,12,2,'T','S','S&S','Travel - Kidnap','Be clear about the legal procedures governing arrest in the country.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(387,12,2,'T','S','S&S','Travel - Kidnap','Understand the governments policy on contacts with kidnappers, if it has one.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(388,12,2,'T','S','S&S','Travel - Kidnap','Constitute a CIMT, prepare and regularly update the plan and provide specialist training.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(389,12,2,'T','S','S&S','Travel - Kidnap','Keep a full record of staff details, including ID and family contact details and medical information.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(390,12,2,'O','S','S&S','Travel - Kidnap','Prior to deployment make sure your domestic affairs are in order. Ideally the following should be readily accessible: birth certificate; marriage/ divorce certificate; insurance policies; medical and dental records; naturalization papers; adoption/guardianship records; military record; power of attorney; key financial papers; and contact details of doctors, lawyers and other key professionals.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(391,12,2,'O','S','S&S','Travel - Kidnap','Be aware of the risks, stay informed about security situation. Learn about risks and how to control them.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(392,12,2,'O','S','S&S','Travel - Kidnap','Be alert, all the time.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(393,12,2,'O','S','S&S','Travel - Kidnap','Familiarize yourself with the physical environment; carry a map if possible.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(394,12,2,'O','S','S&S','Travel - Kidnap','If on medication, carry a small supply; carry a spare set of contact lenses or spectacles. Carry a note on any special medical requirements, in local languages as well.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(395,12,2,'O','S','S&S','Travel - Kidnap','Wear good walking boots.','','P','*','*','R','*','',0,0,'','UNDSS & HPN documents'),(396,12,2,'O','S','S&S','Travel - Kidnap','Be prepared to be held for a long period of time, and possibly by more than one group.','','A','*','*','R','*','',0,0,'','UNDSS documents');
